import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import {
  Container,
  Paper,
  TextField,
  Button,
  Typography,
  Box,
  Alert,
  Divider,
  CircularProgress,
  Card,
  CardContent
} from '@mui/material';
import { AccountCircle } from '@mui/icons-material';
import { useAuth } from '../../contexts/AuthContext';

const Login = () => {
  const navigate = useNavigate();
  const { login } = useAuth();
  const [formData, setFormData] = useState({
    email: '',
    password: ''
  });
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      console.log('Attempting client login with:', formData.email);
      const user = await login(formData.email, formData.password);

      if (!user) {
        setError('Login failed. Please check your credentials.');
        setLoading(false);
        return;
      }

      // Check if user is a client
      if (user.role !== 'client') {
        setError('This is not a client account. Please go to the staff login page.');
        setLoading(false);
        return;
      }

      // Redirect to client dashboard
      navigate('/client');

    } catch (error) {
      console.error('Login error:', error.response?.data || error.message);
      setError(error.response?.data?.message || 'Failed to log in. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  return (
    <Container maxWidth="sm" sx={{ pt: 8 }}>
      <Paper elevation={3} sx={{ p: 4, display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        <AccountCircle fontSize="large" sx={{ mb: 2, color: 'primary.main' }} />
        <Typography variant="h5" component="h1" gutterBottom>
          Client Login
        </Typography>
        <Typography variant="body2" color="text.secondary" align="center" sx={{ mb: 3, maxWidth: 400 }}>
          Access your support tickets and request technical assistance
        </Typography>

        {error && <Alert severity="error" sx={{ width: '100%', mb: 3 }}>{error}</Alert>}

        <Box component="form" onSubmit={handleSubmit} sx={{ width: '100%' }}>
          <TextField
            margin="normal"
            required
            fullWidth
            id="email"
            label="Email Address"
            name="email"
            autoComplete="email"
            autoFocus
            value={formData.email}
            onChange={handleChange}
            placeholder="your-email@example.com"
          />
          <TextField
            margin="normal"
            required
            fullWidth
            name="password"
            label="Password"
            type="password"
            id="password"
            autoComplete="current-password"
            value={formData.password}
            onChange={handleChange}
          />
          <Button
            type="submit"
            fullWidth
            variant="contained"
            sx={{ mt: 3, mb: 2 }}
            disabled={loading}
          >
            {loading ? <CircularProgress size={24} /> : 'Sign In'}
          </Button>

          <Box sx={{ textAlign: 'center' }}>
            <Typography variant="body2">
              Don't have an account?{' '}
              <Link to="/auth/register" style={{ textDecoration: 'none' }}>
                Register here
              </Link>
            </Typography>
          </Box>

          <Divider sx={{ my: 3 }}>
            <Typography variant="caption" color="text.secondary">
              Are you staff?
            </Typography>
          </Divider>

          <Box sx={{ textAlign: 'center' }}>
            <Button 
              variant="outlined" 
              size="medium"
              onClick={() => navigate('/auth/staff-login')}
            >
              Go to Staff Login
            </Button>
          </Box>

          {process.env.NODE_ENV === 'development' && (
            <Box sx={{ mt: 3, textAlign: 'center' }}>
              <Divider sx={{ my: 2 }}>
                <Typography variant="caption" color="text.secondary">
                  Development Only
                </Typography>
              </Divider>
              <Link to="/auth/login-bypass" style={{ textDecoration: 'none' }}>
                <Button size="small" color="secondary">
                  Bypass Login (Dev)
                </Button>
              </Link>

              <Card variant="outlined" sx={{ mt: 2, textAlign: 'left' }}>
                <CardContent>
                  <Typography variant="subtitle2" color="primary">
                    Demo Client Account
                  </Typography>
                  <Typography variant="caption" display="block" gutterBottom>
                    Email: client@example.com
                  </Typography>
                  <Typography variant="caption" display="block">
                    Password: 123456
                  </Typography>
                </CardContent>
              </Card>
            </Box>
          )}
        </Box>
      </Paper>
    </Container>
  );
};

export default Login;
